import React from "react";
import { benefits } from "../../../constants";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import Button2 from "../../../components/Button2";

const Benefits = () => {
  return (
    <section className="">
      <div className="">
        <h1>
          <span>We bring the best to our </span>
          <span>clients</span>
        </h1>
        <p>
          We are dedicated to bringing the best to our clients, helping you
          achieve optimal health and well-being. Explore our premium range today
          and experience the difference of quality and care.
        </p>
      </div>
      <div className="">
        {benefits.map((benefits, index) => (
          <div key={index} className="">
            <div className="">
              <FontAwesomeIcon icon={benefits.icon} />
              <div className="">
                <h1>{benefits.title}</h1>
                <p>{benefits.description}</p>
              </div>
            </div>
          </div>
        ))}
        <Button2 />
      </div>
    </section>
  );
};

export default Benefits;
